                    "tooltip": "\u590d\u5236\u7ec6\u83cc",
                    "data": "\u590d\u5236\u7ec6\u83cc\u9700\u8981\u51c6\u5907%n1)\u4e00\u4e2a\u65e0\u83cc\u57f9\u517b\u76bf%n2)\u4e00\u4e2a\u8d28\u819c(\u7531\u5e72\u7ec6\u80de\u5236\u6210,\u6216\u5728\u5236\u4f5c\u9176\u6eb6\u6db2\u65f6\u83b7\u5f97)%n3)\u5e72\u7ec6\u80de%n4)\u76f8\u5e94\u6570\u636e\u7403%n5)\u6db2\u6001DNA%n6)\u4e00\u53f0LuV\u751f\u7269\u5b9e\u9a8c\u5ba4%n7)\u514b\u9686\u7ec6\u80de\u5408\u6210\u6a21\u5757%n%n\u6570\u636e\u7403\u53ef\u4ee5\u6539\u6362\u4e3a\u4efb\u610f\u60f3\u8981\u590d\u5236\u7684\u7ec6\u83cc\u6570\u636e. \u8bf7\u8bb0\u4f4f,\u4ee5\u5e38\u89c4\u65b9\u5f0f\u83b7\u5f97\u7b2c\u4e8c\u4e2a\u7ec6\u83cc\u57f9\u517b\u76bf\u53ef\u80fd\u4f1a\u66f4\u5bb9\u6613,\u5e76\u4e14\u901a\u5e38\u5b58\u5728\u4e00\u79cd\u66ff\u4ee3\u65b9\u6cd5,\u8be5\u65b9\u6cd5\u53ef\u4ee5\u5229\u7528\u5176\u4ea7\u751f\u7684\u6db2\u4f53\u4f7f\u5176\u5177\u6709\u66f4\u9ad8\u7684\u6210\u529f\u51e0\u7387.%n%nPS\uff1a \u6b64\u914d\u65b9\u662f\u552f\u4e00\u4f7f\u7528\u6a21\u5757\u7684\u914d\u65b9,\u6240\u4ee5\u4f60\u53ef\u4ee5\u4e00\u773c\u5c31\u770b\u5230,\u4f46\u6570\u5b57\u4f1a\u6539\u53d8,\u6240\u4ee5\u6211\u65e0\u6cd5\u51c6\u786e\u6307\u51fa\u5728\u54ea\u4e2a\u9875\u9762."
