                    "tooltip": "\u4e00\u5207\u7f8e\u597d\u7684\u4e8b\u7269...",
                    "data": "T7\u706b\u7bad. \u5f88\u597d,\u53ea\u5269\u4e00\u4e2a\u4e86. \u5728\u90a3\u4e4b\u524d,\u65b0\u7684\u661f\u7403\u6709: \u598a\u795e\u661f\u3001\u67ef\u4f0a\u4f2f\u5e26\u3001\u9e1f\u795e\u661f\u548c\u51a5\u738b\u661f.%n%n\u51a5\u738b\u661f\u5728\u67ef\u4f0a\u4f2f\u5e26\u4e4b\u524d,\u800c\u598a\u795e\u661f\u548c\u9e1f\u795e\u661f\u5728\u5176\u540e.%n%n\u65b0\u77ff\u8109\u6709\u9ed1\u949a\u3001\u77f3\u69b4\u77f3\u548c\u7ea2\u77f3\u69b4\u77f3\u77ff\u8109. \u65b0\u77ff\u77f3\u6709: \u9ed1\u949a\u3001\u787c\u7802\u3001\u767d\u77f3\u68c9\u3001\u77f3\u69b4\u77f3\u3001\u4e0b\u754c\u4e4b\u661f\u3001\u96c4\u9ec4\u3001\u7ea2\u77f3\u69b4\u77f3\u548c\u9ec4\u77f3\u69b4\u77f3.%n%n\u522b\u5fd8\u4e86\u661f\u7403\u77f3\u5934!%n%n\u6700\u540e\u4e00\u9636\u706b\u7bad\u8bbe\u8ba1\u56fe\u5728\u51a5\u738b\u661f. \u8fd9\u4e5f\u662f\u6700\u540e\u4e00\u4e2a\u5730\u7262."
