                    "tooltip": "\u7535\u8def,\u7ec4\u88c5!",
                    "data": "\u60f3\u8981\u5236\u9020\u6e7f\u4ef6\u7cfb\u5217\u7535\u8def\u677f(UHV\u7b49\u7ea7\u7684\u7535\u8def\u677f),\u4f60\u9700\u8981\u5236\u9020ZPM\u7535\u8def\u7ec4\u88c5\u673a.%n%n\u4ec0\u4e48? \u4f60\u89c9\u5f97\u6709\u4e86\u591a\u65b9\u5757\u5c31\u53ef\u4ee5\u8df3\u8fc7\u8fd9\u4e9b\u5355\u65b9\u5757\u7684\u5347\u7ea7? \u597d\u5427,\u592a\u9057\u61be\u4e86! \u7528\u4e8e\u94ed\u523b\u7684\u7b2c\u4e00\u5757\u7535\u8def\u677f\u5fc5\u987b\u4f7f\u7528\u5355\u65b9\u5757\u7535\u8def\u7ec4\u88c5\u673a\u624d\u80fd\u505a\u51fa\u6765..."
