                    "tooltip": "\u8fd9\u4e0d\u662f\u4f60\u505a\u5976\u916a\u7684\u65b9\u5f0f",
                    "data": "\u6e7f\u4ef6\u7535\u8def\u677f\u9700\u8981\u65e0\u83cc\u57f9\u517b\u57fa\u548c\u5e72\u7ec6\u80de,\u6240\u4ee5\u8ba9\u6211\u4eec\u4ece\u6b64\u5f00\u59cb\u5427!%n%n\u9996\u5148\u9700\u8981\"\u7ec6\u83cc\". \u901a\u8fc7\u7ec6\u83cc\u57f9\u517b\u7f38\u6216\u8005\u917f\u9020\u5ba4\u90fd\u53ef\u4ee5\u83b7\u5f97.\u800c\u57f9\u517b\u7f38\u66f4\u52a0\u9ad8\u6548,\u4e0d\u8fc7\u57f9\u517b\u7f38\u9700\u8981\u57f9\u517b\u7269,\u6240\u4ee5\u8fd8\u662f\u5f97\u5148\u8d70\u917f\u9020\u5ba4\u8fd9\u6761\u8def. \u57f9\u517b\u7f38\u9700\u8981\u81f3\u5c11\u94cb\u6746\u4ee5\u63d0\u4f9b\u8f90\u5c04,\u4ee5\u53caEV\u7b49\u7ea7\u7684\u73bb\u7483. \u67093\u4e2a\u914d\u65b9,\u7a0d\u540e\u4f60\u53ef\u4ee5\u8bd5\u8bd5\u66f4\u9ad8\u9636\u7684\u914d\u65b9.(\u4f7f\u7528\u57f9\u517b\u7f38\u6bd4\u8f83\u7701\u7269\u54c1,\u4f46\u5de5\u5e8f\u66f4\u52a0\u590d\u6742)%n%n\u4f60\u8fd8\u9700\u8981\u8089\u672b\u548c\u743c\u8102. \u6240\u4ee5\u9700\u8981\u4e00\u4e2a\u7a33\u5b9a\u7684\u8089\u7c7b\u6765\u6e90,*\u73e0\u6d77\u6e14\u573a\u3001\u52a8\u7269\u519c\u573a\u6216\u662fIC2\u7684\u4f5c\u7269(Meatrose\u6216Goldfish)\u90fd\u53ef\u4ee5.%n%n\u743c\u8102\u7684\u52a0\u5de5\u94fe\u66f4\u52a0\u590d\u6742,\u4f46\u4e0e\u94c2\u7cfb\u5904\u7406\u6bd4\u8d77\u6765\u5c31\u662f\u5c0f\u5deb\u89c1\u5927\u5deb\u4e86. \u743c\u8102\u9700\u8981\u6d88\u8017\u7684\u8089\u66f4\u591a...%n%n\u7528\u4e00\u4e9b\u7ec6\u83cc\u6765\u5236\u4f5c\u51fa\u5408\u9002\u7684\u57f9\u517b\u76bf(15\uff05\u51e0\u7387),\u7136\u540e\u5c06\u57f9\u517b\u76bf\u653e\u5165\u7ec6\u83cc\u57f9\u517b\u7f38\u7684\u63a7\u5236\u5668\u65b9\u5757\u5373\u53ef\u751f\u6210\u57f9\u517b\u57fa\u539f\u6db2. \u6b64\u914d\u65b9\u8981\u6c42\u81f3\u5c11IV\u7b49\u7ea7\u7684\u73bb\u7483\u548c\u94c0\u6746\u63d0\u4f9b\u8f90\u5c04. \u8fd8\u6709\u66f4\u9ad8\u9636\u7684\u914d\u65b9.%n%n\u57f9\u517b\u76bf\u5728\u7ec6\u83cc\u57f9\u517b\u7f38\u4e2d\u4e0d\u4f1a\u88ab\u6d88\u8017."
